	(CORE_SEQ, CORE_BOARD_ID, CORE_WRITER_ID, CORE_CONTENT, CORE_ROOT_SEQ, CORE_STEP, CORE_CHAETAEK, CORE_STATE)
	VALUES(23, 'JI'||TO_CHAR(CURRENT_DATE,'yyyymmdd')||'0078', 'TMTD3', '<p style="margin-left:0px;">Handlebars.js에서 콘텐츠를 HTML로 해석하기 위해서는 <code>{{{content}}}</code> 또는 <code>{{html content}}</code>와 같이 중괄호(<code>{}</code>)를 세 개 사용하여 감싼 템플릿 표현을 사용해야 합니다.&nbsp;</p><p style="margin-left:0px;">이렇게 하면 Handlebars.js가 해당 부분을 HTML로 인식하고 출력할 때 태그들이 유효한 HTML 요소로 처리됩니다.</p><p style="margin-left:0px;">따라서, 위의 코드에서 <code>{{{value}}}</code>를 사용하여 <code>value</code> 변수 내에 있는 내용을 HTML로 해석하도록 지정할 수 있습니다.</p><p style="margin-left:0px;">또는 <code>{{{html value}}}</code>와 같은 방식으로도 동일한 결과를 얻을 수 있습니다.</p>', 23, 0, 'N', 'N')
	INTO COMMUNITY_REPLY
	(CORE_SEQ, CORE_BOARD_ID, CORE_WRITER_ID, CORE_CONTENT, CORE_ROOT_SEQ, CORE_STEP, CORE_CHAETAEK, CORE_STATE)
	VALUES(24, 'JI'||TO_CHAR(CURRENT_DATE,'yyyymmdd')||'0078', 'TMTD2', '<p>헬퍼 함수를 등록하여 html 태그를 포함하는지 여부를 확인하여 상황에 맞는 적용이 가능합니다!</p><pre><code class="language-javascript">&lt;script id="page-list-template" type="text/x-handlebars-template"&gt;
	{{#each page}}
		&lt;li class="page-item {{state}}"&gt;
			&lt;span class="page-link" id="{{id}}"&gt;{{{htmlOrText value}}}&lt;/span&gt;
		&lt;/li&gt;
	{{/each}}
&lt;/script&gt;</code></pre><pre><code class="language-javascript">// Handlebars.js 템플릿 컴파일 시, htmlOrText 헬퍼 함수 등록
Handlebars.registerHelper(''htmlOrText'', function(value) {
    // value가 HTML 태그를 포함하는지 여부 확인
    const containsHtmlTags = /&lt;[a-z][\s\S]*&gt;/i.test(value);

    // value가 HTML 태그를 포함하면서 안전한 방법으로 출력하기 위해 {{{}}} 사용
    if (containsHtmlTags) {
        return new Handlebars.SafeString(value);
    }

    // value가 일반 문자열인 경우 {{}} 사용하여 출력
    return value;
});</code></pre>', 24, 0, 'N', 'N')
	INTO COMMUNITY_REPLY
